import React from 'react';
import './QuickStartOptions.css';

const QuickStartOptions = () => {
  return (
    <section className="quick-start">
      <div className="option-card">
        <h3>Jugar Online</h3>
        <p>Encuentra un oponente y comienza una partida ahora</p>
        <button className="btn-play">Jugar Ahora</button>
      </div>
      
      <div className="option-card">
        <h3>Jugar vs Computadora</h3>
        <p>Practica y mejora tu juego contra la IA</p>
        <button className="btn-play">Jugar vs CPU</button>
      </div>
    </section>
  );
};

export default QuickStartOptions;
